let newTh = (table, label, rowNumber = 0) => { let th = document.createElement('th'); th.textContent = label; table.rows[rowNumber].appendChild(th); }
let newTd = (row, value) => { let td = document.createElement('td'); td.textContent = value; td.setAttribute('class', 'numeric'); row.appendChild(td); }
let fillRows = (rows, fnKey, fnValue, skip = index => index === 0) => {
    for (let row of rows) {
        if (skip(row.rowIndex)) { continue }
        let val = fnValue(fnKey(row))
        newTd(row, val)
    }
}
let assignmentStats = (table) => {
    let result = { data: {}, errs: [] }
    result.data = Array.from(table.rows).reduce((acc, row) => {
        if (row.rowIndex <= table.simyo_rowHead) { return acc }
        let cell = row.cells[table.simyo_cIndex]
        let checked = row.cells[0].firstElementChild.checked
        let cellData = cellToAssignmentStats(cell, checked)
        if (cellData == null) { result.errs.push(`Could not parse row "${cell.innerText}"`) }
        else { Object.keys(acc).forEach(x => { acc[x] += cellData[x] }) }
        return acc
    }, { count: 0, green: 0, pax: 0, weight: 0, count_sel: 0, green_sel: 0, pax_sel: 0, weight_sel: 0 })
    return result
}
let cellToAssignmentStats = (cell, checked) => {
    let count = 1, green = 0, pax = 0, weight = 0
    let count_sel = checked ? 1 : 0, green_sel = 0, pax_sel = 0, weight_sel = 0
    if (cell?.firstElementChild?.nodeName === 'FONT') {
        green++
        let greenPax = Number(trim(cell.innerText.split(' ')[0]))
        pax += greenPax
        weight += greenPax * 77
        if (checked) { green_sel += 1; pax_sel += greenPax; weight_sel += greenPax * 77 }
    } else if (cell?.innerText?.endsWith('kg')) {
        let split = cell.innerText.split(' ')
        weight += Number(trim(split[split.length - 1].slice(0, -2)))
        if (checked) { weight_sel += Number(trim(split[split.length - 1].slice(0, -2))) }
    } else if (/^\d+ Passengers?/.test(cell?.innerText?.trim()) | /^\d+ Pax/.test(cell?.innerText?.trim())) {
        let paxHere = Number(trim(cell.innerText.split(' ')[0]))
        pax += paxHere
        weight += paxHere * 77
        if (checked) { pax_sel += paxHere; weight_sel += paxHere * 77 }
    } else if (/^GroupAssignment?$/.test(trim(cell?.innerText))) {
        ; // They don't matter, right?
    } else {
        return null
    }
    log("Parsed cell", cell.innerText, '=>', { count, green, pax, weight, count_sel, green_sel, pax_sel, weight_sel })
    return { count, green, pax, weight, count_sel, green_sel, pax_sel, weight_sel }
}
let active = (f) => activeFunctions.indexOf(f) > -1
let run = (firstTime = 0) => {
    log(`${name}: main function runs`) //`DNE
    for (let table of qq('table')) {
        if (!table.classList.contains('tablesorter')) { continue }
        let _break = false
        log(`${name}: Checking table ${table.classList[0]} (${table.caption.innerText.trim()})`)
        switch (table.classList[0]) {
            case 'assigmentTable' : // Airport -> Assignments
            case 'assignmentTable': // My Flight -> Assignments, Group -> Assignments
            case 'holdTable': { // My Flight -> Hold
                if (firstTime) {
                    let cIndex = Array.from(table.rows[trim(table.caption.innerText).startsWith('Assignmentsfor') ? 1 : 0].cells).filter(x => trim(x.innerText) === 'Cargo')
                    if (cIndex.length === 0) { log(`Could not find cargo column in table "${table.classList[0].trim()}" (${table.caption.innerText.trim()})`); break }
                    cIndex = cIndex[0].cellIndex
                    table.simyo_cIndex = cIndex
                    table.simyo_rowHead = trim(table.caption.innerText).startsWith('Assignmentsfor') ? 1 : 0
                    /* for (let row of table.rows) { row.cells[0].firstElementChild.addEventListener('input', () => { window.simyo_run() }) }
                    /*for (let row of table.rows) {
                        row.addEventListener('click', (evt) => { window.simyo_run() })
                    } // These methods are too slow... */
                    let idStrip = `simyoStats_${trim(table.caption.innerText)}`
                    for (let row of table.rows) { row.cells[0].firstElementChild.addEventListener('click', (evt) => {
                        if (event.shiftKey) { setTimeout(window.simyo_run, 0); return }
                        log(evt, evt.target, table, row);
                        let delta = cellToAssignmentStats(row.cells[table.simyo_cIndex], evt.target.checked)
                        q(`#${idStrip}_count_sel`).innerText = Number(q(`#${idStrip}_count_sel`).innerText) + (evt.target.checked ? 1 : -1)
                        q(`#${idStrip}_green_sel`).innerText = Number(q(`#${idStrip}_green_sel`).innerText) + (evt.target.checked ? 1 : -1) * delta.green
                        q(`#${idStrip}_pax_sel`).innerText = Number(q(`#${idStrip}_pax_sel`).innerText) + (evt.target.checked ? 1 : -1) * delta.pax
                        q(`#${idStrip}_weight_sel`).innerText = Number(q(`#${idStrip}_weight_sel`).innerText) + (evt.target.checked ? 1 : -1) * delta.weight
                        //window.simyo_run()
                    }) }
                }
                let result = (() => {
                    if (trim(table.caption.innerText) === 'LoadingArea') {
                        if (!active('myflightStatsLoad')) { log(`${name}: myflightStats are disabled, skipping`); return null }
                        return assignmentStats(table)
                    } else if (trim(table.caption.innerText) === 'HoldingArea') {
                        if (!active('myflightStatsHold')) { log(`${name}: myflightStatsHold are disabled, skipping`); return null }
                        return assignmentStats(table)
                    } else if (trim(table.caption.innerText).startsWith('Assignmentsfor')) {
                        if (!active('groupAssignmentStats')) { log(`${name}: groupAssignmentStats are disabled, skipping`); return null }
                        return assignmentStats(table)
                    } else if (trim(table.caption.innerText).startsWith('Assignments')) {
                        if (!active('airportAssisgnmentStats')) { log(`${name}: airportAssisgnmentStats are disabled, skipping`); return null }
                        return assignmentStats(table)
                    }
                    return null
                })()
                if (result == null) { log(`${name}: Not implemented: ${table.classList[0]} (${table.caption.innerText.trim()})`); break }
                log(`${name} (data):`, result.data)
                if (result.errs.length > 0) { log(`${name} has encountered some errors:\n${result.errs.join('\n')}`) }
                let idStrip = `simyoStats_${trim(table.caption.innerText)}`
                if (firstTime) { table.insertAdjacentHTML('afterend', `<div id="${idStrip}"></div>`); table.insertAdjacentHTML('afterend', `<a onclick="setTimeout(window.simyo_run, 0)">Refresh selected count</a>`) }
                q(`#${idStrip}`).innerHTML = [
                    `Number of assignments: <strong>${result.data.count}</strong> (checked: <strong><span id=${idStrip}_count_sel>${result.data.count_sel}</span></strong>)`,
                    `Number of greens: <strong>${result.data.green}</strong> (checked: <strong><span id=${idStrip}_green_sel>${result.data.green_sel}</span></strong>)`,
                    `Number of passengers: <strong>${result.data.pax}</strong> (checked: <strong><span id=${idStrip}_pax_sel>${result.data.pax_sel}</span></strong>)`,
                    `Total weight: <strong>${result.data.weight}kg</strong> (checked: <strong><span id=${idStrip}_weight_sel>${result.data.weight_sel}</span>kg</strong>)`,
                ].join('<br>')
                break
            }
            case 'configTable': {
                if (!active('aircraftModelList')) { log(`${name}: aircraftModelList are disabled, skipping`); break }
                let fnKey = row => rowStr(row, 0)
                let fnValue = mult => id => { let data = craftData(id); return Number(data.cMax - (data.fMax * mult * 2.688) - (77 * data.crew)).toFixed(0) }
                    ; // DNE
                ['Price', 'Pass. seats', 'Cargo@1/4', 'Cargo@1/2', 'Cargo@Full'].forEach(x => newTh(table, x))
                fillRows(table.rows, fnKey, id => { let data = craftData(id); return data.price })
                fillRows(table.rows, fnKey, id => { let data = craftData(id); return data.pax - 2 })
                    ; // DNE
                [.25, .5, 1].forEach(mult => fillRows(table.rows, fnKey, fnValue(mult)))
                break;
            }
            case 'aircraftTable': {
                if (!active('availableAircraft')) { log(`${name}: availableAircraft are disabled, skipping`); break }
                let rowHeadNumber = 0
                let skipRows = index => index === 0
                if (trim(table.caption.innerText) === 'Aircraftforsale') { rowHeadNumber = 1; skipRows = index => index <= 1 }
                let fnKey = row => rowStr(row, 1)
                let fnValue = mult => id => { let data = craftData(id); return Number(data.cMax - (data.fMax * mult * 2.688) - (77 * data.crew)).toFixed(0) }
                    ; // DNE
                ['Price', 'Pass. seats', 'Cargo@1/4', 'Cargo@1/2', 'Cargo@Full'].forEach(x => newTh(table, x, rowHeadNumber))
                fillRows(table.rows, fnKey, id => { let data = craftData(id); return data.price }, skipRows)
                fillRows(table.rows, fnKey, id => { let data = craftData(id); return data.pax - 2 }, skipRows)
                    ; // DNE
                [.25, .5, 1].forEach(mult => fillRows(table.rows, fnKey, fnValue(mult), skipRows))
                break;
            }
            default:
                _break = true
                log(`${name}: Not implemented table: ${table.classList[0]} (${table.caption.innerText.trim()})`)
        }
        if (!_break) { $(table).trigger('updateAll') }
    }
}
run(1)
window.simyo_run = () => { run() }
console.log(`${name} loaded, took ${Number(performance.now() - t0).toFixed(3)}ms`)